const MenuItem = ({className, item, onSectionToScroll}) => {
  return (
    <li className={`${className}__item`}>
      <button 
        data-btn="menu" 
        data-target={item.target}
        onClick={onSectionToScroll}
      >
        <span>{item.data}</span>
      </button>
    </li>
  )
}

export default MenuItem
